const PhotoStrip = ({ photos }) => {
    const photoImages = photos.map((p) => {
        return (
            <img
                src={`http://localhost:8000/images/${p}`}
                alt="photobooth pic"
                key={p}
            />
        );
    });
    return <div>{photoImages}</div>;
};

export default PhotoStrip;
